import React from 'react'; 

function Notes(props){

	const listdata={	
	  listStyleType:'none',
      margin:0,
      padding:0,
      boxSize:'border-box',
      paddingLeft:'20px'
	}


		return(
			<div>
				<ul>
					<li style={listdata}><button>d</button>{props.item}</li>

				</ul>


			</div>
		)
}

export default Notes;
